import React from "react";
import styled from "styled-components";

export default function score() {
  return (
    <Score>
      You scored {this.props.score} out of {quiz.length}
    </Score>
  );
}

const Score = styled.div`
  text-align: center;
  background-color: #dfdfdf4b;
  font-weight: 700;
  padding: 1%;
`;
